function initPushwoosh(){var pushNotification=window.plugins.pushNotification;pushNotification.onDeviceReady();pushNotification.registerDevice({alert:true,badge:true,sound:true,pw_appid:"2A0A5-F4D2A",appname:"testing"},function(status){var deviceToken=status.deviceToken;},function(status){navigator.notification.alert(JSON.stringify(['failed to register ',status]));});pushNotification.setApplicationIconBadgeNumber(0);pushNotification.getTags(function(tags){},function(error){});document.addEventListener('push-notification',function(event){var notification=event.notification;navigator.notification.alert(notification.aps.alert);pushNotification.setApplicationIconBadgeNumber(0);});}var app={initialize:function(){this.bindEvents();},bindEvents:function(){document.addEventListener('deviceready',this.onDeviceReady,false);},onDeviceReady:function(){initPushwoosh();app.receivedEvent('deviceready');},receivedEvent:function(id){var parentElement=document.getElementById(id);var listeningElement=parentElement.querySelector('.listening');var receivedElement=parentElement.querySelector('.received');listeningElement.setAttribute('style','display:none;');receivedElement.setAttribute('style','display:block;');console.log('Received Event: '+id);}};